import React from 'react';
import backgroundPic from '../../../Logo/healthy-diet.jpg'


export default class HomeContainer extends React.Component {
    render(){
        
        return (
            <div style={{position:'absolute',marginTop:'40px',marginLeft:'-220px'}}>
            <div style={{ backgroundImage:`url(${backgroundPic})`,width:'100%'}}>
            <h1>This is red car</h1>
            </div>
            </div>
        )}
}
